	(79,'Sam Altman\'s Top 10 Rules For Success','Modern versions of assistive technologies will announce CSS generated content, as well as specific Unicode characters. To avoid unintended and confusing output in screen readers (particularly when icons are used purely for decoration), we hide them with the aria-hidden=\"true\" attribute.<br><br>If you\'re using an icon to convey meaning (rather than only as a decorative element), ensure that this meaning is also conveyed to assistive technologies – for instance, include additional content, visually hidden with the .sr-only class.<br><br>If you\'re creating controls with no other text (such as a &lt;button&gt; that only contains an icon), you should always provide alternative content to identify the purpose of the control, so that it will make sense to users of assistive technologies. In this case, you could add an aria-label attribute on the control itself.','iRLyLQos6FQ',5,1,1491818260,NULL),
